// User variables
const minStudyPay = 9.00;

var app = document.querySelector('#app');
var studies = new Set();

function playAlertSound() {
  // https://notificationsounds.com/notification-sounds/plucky-564
  const audio = new Audio('data:audio/mp3;base64,');
  audio.play();
}

function waitForElm(selector) {
    return new Promise(resolve => {
        if (document.querySelector(selector)) {
            return resolve(document.querySelector(selector));
        }

        const observer = new MutationObserver(mutations => {
            if (document.querySelector(selector)) {
                resolve(document.querySelector(selector));
                observer.disconnect();
            }
        });

        observer.observe(document.body, {
            childList: true,
            subtree: true
        });
    });
}

var observeDOM = (function(){
  var MutationObserver = window.MutationObserver || window.WebKitMutationObserver;

  return function( obj, callback ){
    if( !obj || obj.nodeType !== 1 ) return;

    if( MutationObserver ){
      // define a new observer
      var mutationObserver = new MutationObserver(callback)

      // have the observer observe foo for changes in children
      mutationObserver.observe( obj, { childList:true, subtree:true })
      return mutationObserver
    }

    // browser support fallback
    else if( window.addEventListener ){
      obj.addEventListener('DOMNodeInserted', callback, false)
      obj.addEventListener('DOMNodeRemoved', callback, false)
    }
  }
})()

// studies

observeDOM(app, function(m){

    m.forEach((record) => {
        var studyAdded = [...record.addedNodes].some((node) => node.className === 'list');

        if (studyAdded) {
            for (var node of [...record.addedNodes[0].children]) {
                if (parseInt((node.textContent.split("£")[2]).split("/")[0]) >= minStudyPay) {
                    var studiesLength = studies.size;
                    studies.add(node);
                    localStorage.setItem("temp", node);
                    if (studiesLength < studies.size) {
                        playAlertSound();
                    }
                }
            }
            //playAlertSound();
            //console.log("Works");
        }
    })

    console.clear();
    console.log('Studies:', studies);
});

// Removes animation

waitForElm('#app').then((elm) => {
    var toggleAnimation = document.getElementsByClassName("toggle-animation")[0];
    if(typeof(toggleAnimation) != 'undefined' && toggleAnimation != null && toggleAnimation.innerText.match("Disable animation")) {
        toggleAnimation.click();
        toggleAnimation.innerText = "";
    }
});

waitForElm('el-notification').then((elm) => {
    var Notification = document.getElementsByClassName("el-button")[0];
    if(typeof(Notification) != 'undefined' && Notification != null) {
        Notification.click();
    }
});
